import React, { useEffect, useState } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import { useParams, Link } from "react-router-dom";
import axios from "axios";
import sections from "../data/Sections";
import articles from "../data/Articles";
import "../styles/Home.css";

function SampleArrow(props) {
  const { className, style, onClick } = props;
  return (
    <div
      className={className}
      style={{
        ...style,
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        background: "#f3dc17",
        borderRadius: "12px",
        width: "22px",
        height: "22px",
      }}
      onClick={onClick}
    />
  );
}

function Home() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 2500,
    slidesToShow: 1,
    slidesToScroll: 1,
    nextArrow: <SampleArrow />,
    prevArrow: <SampleArrow />,
    autoplay: true,
    autoplaySpeed: 2500,
    cssEase: "linear",
  };

  const [frontPageArt, setFrontPageArt] = useState([]);
  const [newArt, setNewArt] = useState([]);
  const [dontMissArt, setDontMissArt] = useState([]);
  const [seeWachtArt, setSeeWachtArt] = useState([]);
  const [drinksFoodArt, setDrinksFoodArt] = useState([]);
  const [wellnessArt, setWellnessArt] = useState([]);
  const [fashionArt, setFashion] = useState([]);

  const fetchData = () => {
    const frontPageArtRouteAPI = "http://localhost:8000/frontpage";
    const newArtRouteAPI = "http://localhost:8000/frontpage";
    const dontMissArtRouteAPI = "http://localhost:8000/frontpage";
    const seeWachArtRouteAPI = "http://localhost:8000/frontpage";
    const drinksFoodArtRouteAPI = "http://localhost:8000/frontpage";
    const wellnessArtRouteAPI = "http://localhost:8000/frontpage";
    const fashionArtRouteAPI = "http://localhost:8000/frontpage";
  };

  return (
    <div className="home-body-container">
      {/* Section no.1 */}
      <div className="carousel-container">
        <Slider {...settings}>
          <div className="carousel-item">
            <h3>1</h3>
          </div>
          <div className="carousel-item">
            <h3>2</h3>
          </div>
          <div className="carousel-item">
            <h3>3</h3>
          </div>
        </Slider>
      </div>
      {/* Section no.2 */}
      <div className="news-container">
        <div className="section-label">
          <p className="text-section-label">Lo más nuevo</p>
        </div>
      </div>
      <div className="articles-container">
        <div className="wrapper">
          {articles.map((article) => (
            <Link
              className="link-article"
              to={"/article/" + sections[1].section + article.id}
            >
              <div className="article" key={article.id}>
                {article.cover && (
                  <img
                    className="cover-article"
                    src={article.cover}
                    alt="cover"
                  />
                )}
                <div className="text-container">
                  <p className="type-article text-mod">{article.section}</p>
                  <h3 className="title-article text-mod">{article.title}</h3>
                  <p className="date-article text-mod">{article.date}</p>
                </div>
              </div>
            </Link>
          ))}
        </div>
      </div>
      {/* Section no.3 */}
      <div className="news-container">
        <div className="section-label">
          <p className="text-section-label">No te pierdas...</p>
        </div>
      </div>
      <div className="dont-miss-container">
        <img className="dont-miss-img" src={articles[1].cover} alt="cover" />
        <div className="dont-miss-article-container">
          <p className="section-dont-miss-in">{articles[1].section}</p>
          <h2 className="title-dont-miss-in">{articles[1].title}</h2>
          <p className="date-dont-miss-in">{articles[1].date}</p>
        </div>
      </div>
      {/* Section no.4 */}
